import React from 'react';


function InProgressColumn({ tasks, addTask, removeTask }) {
    return (
      <div className="column in-progress">
        <h2>In Progress</h2>
        <ul>
          {tasks.map(task => (
            <li key={task.id}>
              {task.text}
              <button onClick={() => removeTask(task.id, 'inProgress')}>删除</button>
            </li>
          ))}
        </ul>
      </div>
    );
  }


export default InProgressColumn;
